import React, {Component} from "react";

class FailingPage extends Component {
    constructor(prop) {
        super(prop);
        // inheritated from FocusArea: this.props.valueFromParent
        this.state = {
            schedule: [],
        };
    }

    render() {
        return (
            <div>
            <h1
                    style={{
                        display: "flex",
                        justifyContent: "center",
                        alignItems: "center",
                    }}
                >
                    Oops!
                </h1>

            <div>It seems like that you may not be able to graduate based on courses you have taken.</div>
                </div>
        );
    }
}

export default FailingPage;
